import React from "react";
import headerNavbar from "./HeaderNavbar.module.css"

const HeaderNavbar = (props) => {
    return (
        <ul className={headerNavbar.list}>
            <a className={headerNavbar.item}>Home</a>
            <a className={headerNavbar.item}>Products</a>
            <a className={headerNavbar.item}>Chats</a>
        </ul>
    )
}

export default HeaderNavbar
